const BestPokemon = (propBest) => {
            return  <>
                      <ul>
                        {propBest.abilities.map((name) =>(
                          <li>{name}</li>))}
                      </ul>
                      <p>Para mi el mejor pokemon es El mago oscuro</p>
                    </>
    }

export default BestPokemon;
